import{_ as p,c as e,o as t,a as r}from"./app.af7f7d8f.js";const b='{"title":"\u6C38\u9060\u306E\u80F8","description":"","frontmatter":{},"relativePath":"Album/5-Birth/\u6C38\u9060\u306E\u80F8.md","lastUpdated":1640481415094}',a={},_=r('<h1 id="\u6C38\u9060\u306E\u80F8" tabindex="-1">\u6C38\u9060\u306E\u80F8 <a class="header-anchor" href="#\u6C38\u9060\u306E\u80F8" aria-hidden="true">#</a></h1><p>\u4E2D\u8B6F: \u6C38\u9060\u7684\u5FC3</p><p>\u4F5C\u8A5E\u30FB\u4F5C\u66F2: \u5C3E\u5D0E\u8C4A</p><p>\u7DE8\u66F2: \u5C3E\u5D0E\u8C4A\u30FB\u661F\u52DD</p><hr><p>\u61F7\u8457\u5B64\u7368\u5BC2\u5BDE\u7684\u610F\u7FA9\u800C\u904E\u7684\u6BCF\u4E00\u5929\u554A</p><p>\u6703\u5426\u627E\u5230 \u80CC\u8CA0\u5B64\u7368\u904E\u6D3B</p><p>\u8B49\u660E\u5FC3\u6C92\u6709\u88AB\u73B7\u6C61\u7684\u8DEF\u6A19\u5462</p><p>\u9047\u4E0A\u8A31\u591A\u4E0D\u540C\u7684\u4EBA \u70BA\u4E86\u6E9D\u901A\u800C\u611F\u5230\u8FF7\u832B</p><p>\u5FEB\u8981\u8FF7\u5931\u771F\u6B63\u7684\u81EA\u5DF1\u6642 \u5728\u4F60\u8EAB\u4E0A\u6211\u6726\u6727\u5730\u770B\u5230\u81EA\u5DF1</p><p>\u771F\u6B63\u7684\u6211\u5BE6\u5728\u662F\u592A\u6E3A\u5C0F\u4E86</p><p>\u5728\u6211\u5FC3\u51B0\u51CD\u7684\u6642\u5019 \u4E00\u5B9A\u53C8\u6703\u518D\u770B\u4E0D\u5230\u4F60</p><p>Oh \u4EBA\u53EA\u662F\u70BA\u4E86\u5C0B\u627E</p><p>\u60B2\u50B7\u7684\u610F\u7FA9\u800C\u51FA\u751F\u55CE</p><p>Oh \u6211\u60F3\u53BB\u78BA\u8A8D \u5982\u679C\u6709\u53BB\u88C1\u6C7A\u7684\u6771\u897F\u7684\u8A71</p><p>\u6211\u4E5F\u53EF\u4EE5\u7528\u529B\u5730\u62B1\u8457\u4F60\u7684\u8EAB\u5F71</p><p>\u5B89\u5FC3\u5730\u4E0D\u65B7\u53BB\u5C0B\u627E\u90A3\u500B\u5373\u5C07\u627E\u5230\u7684\u7B54\u6848 \u6C38\u6C38\u9060\u9060</p><br><p>\u5B58\u5728\u7121\u6CD5\u627F\u53D7\u7684\u611B \u4E5F\u5B58\u5728\u7121\u6CD5\u6D88\u9664\u7684\u50B7\u75D5</p><p>\u70BA\u4E86\u4E0D\u6703\u5FD8\u8A18 \u9760\u8457\u6240\u6709\u56DE\u61B6\u6240\u7D66\u4E88\u6211\u7684</p><p>\u7CBE\u795E\u98DF\u7CE7\u800C\u751F</p><p>\u90A3\u88E1\u6709\u8457\u5404\u7A2E\u6B63\u7FA9 \u4E0D\u65B7\u53BB\u5C0B\u6C42\u5E78\u798F</p><p>\u6B32\u671B\u50CF\u8981\u4EE4\u6211\u5FC3\u5D29\u6F70</p><p>\u96D6\u7136\u60F3\u53BB\u76F8\u4FE1\u4EBA\u5FC3\u88E1\u7684\u611B</p><p>\u4F46\u4EBA\u751F\u6D3B\u4E2D\u7684\u5E78\u798F\u5BE6\u5728\u592A\u6E3A\u5C0F\u4E86</p><p>\u6240\u6709\u4EBA\u90FD\u7121\u6CD5\u6253\u958B\u81EA\u5DF1\u7684\u5FC3\u9396</p><p>Oh \u5982\u4ECA\u6211\u53EA\u60F3\u50CF\u7E7C\u7E8C\u5B88\u8B77\u5E78\u798F\u7684\u610F\u7FA9\u90A3\u6A23</p><p>\u53BB\u62B1\u7DCA\u4F60</p><p>Oh \u60F3\u53BB\u76F8\u4FE1 \u5047\u82E5\u6709\u6771\u897F\u80FD\u7D66\u4E88\u6211\u771F\u5BE6\u7684\u611B\u7684\u8A71</p><p>\u6211\u8981\u5C07\u6211\u7684\u8EAB\u5FC3\u5949\u4E0A \u56E0\u70BA\u90A3\u5C31\u662F\u611B \u90A3\u5C31\u662F\u6B32\u671B</p><p>\u90A3\u5C31\u662F\u638C\u7BA1\u4E00\u5207\u7684\u6771\u897F\u7684\u771F\u5BE6</p><br><p>(\u7368\u767D)</p><p>\u4EFF\u5982\u7AD9\u5728\u61F8\u5D16\u5CED\u58C1\u822C\u4EF0\u671B\u591C\u7A7A</p><p>\u6211\u8981\u8A66\u8457\u5411\u5F77\u5F7F\u5FEB\u8981\u628A\u6211\u5438\u9032\u53BB\u7684\u5929\u7A7A\u547C\u558A</p><p>\u5C07\u8981\u8D70\u5411\u4F55\u8655 \u7AD9\u5728\u5927\u5730\u4E0A\u7684\u6211</p><p>\u662F\u70BA\u4E86\u751A\u9EBC\u800C\u51FA\u751F\u554A</p><p>\u5047\u5982\u51FA\u751F\u662F\u6709\u610F\u7FA9 \u6211\u6240\u5C0B\u6C42\u7684\u6771\u897F\u662F\u5B58\u5728\u7684\u8A71</p><br><p>Oh \u6211\u60F3\u53BB\u50B3\u9054 \u50B3\u9054\u6211\u6240\u5B78\u5230\u7684\u4E00\u5207</p><p>\u50B3\u9054\u5C0B\u6C42\u7121\u9650\u5E78\u798F\u7684\u4E00\u5207</p><p>Oh \u6211\u60F3\u53BB\u5206\u4EAB \u5206\u4EAB\u6709\u95DC\u751F\u5B58\u7684\u4E00\u5207</p><p>\u5206\u4EAB\u90A3\u85CF\u5728\u5FC3\u88E1\u7684\u6771\u897F\u7684\u6A21\u6A23 \u5206\u4EAB\u771F\u5BE6\u7684\u6211\u7684\u6A21\u6A23</p><p>\u6211\u5E0C\u671B\u4F60\u53BB\u76F8\u4FE1 \u5E0C\u671B\u4F60\u53BB\u63A5\u6536</p><p>\u5047\u82E5\u90A3\u5C31\u662F\u70BA\u4E86\u751F\u5B58\u800C\u5B58\u5728\u7684\u611B\u7684\u8A71 \u5982\u4ECA \u6211\u8877\u5FC3\u5E0C\u671B</p><br><p>\u6211\u6C38\u9060\u90FD\u5728\u9019\u88E1 \u5C31\u7B97\u4F60\u56E0\u6EFF\u76EE\u773C\u6DDA\u800C\u751A\u9EBC\u4E5F\u770B\u4E0D\u5230\u4E5F\u597D</p><p>\u6211\u6C38\u9060\u90FD\u5728\u9019\u88E1</p><hr><p>\u8F49\u8F09\u81EA:</p><ul><li><a href="https://web.archive.org/web/20110430113624/http://blog.yam.com/forgetnot/category/711255" target="_blank" rel="noopener noreferrer">\u666E\u901A\u7684\u611B 2008</a></li></ul>',51),o=[_];function n(c,h,s,i,d,l){return t(),e("div",null,o)}var m=p(a,[["render",n]]);export{b as __pageData,m as default};
